    <style>

body{
  font-family: 'Arial',sans-serif;
}
.font-arial{
  font-family: 'Arial',sans-serif;
  cursor: pointer;
}

.main{
    height: 95vh;
    overflow: hidden;
     width: 100%;
    margin: 0 auto;
    position: relative;
}

.cls-4,.cls-6,.cls-7,.cls-8{cursor: pointer;}
       
#controls {
    position: absolute;
    top: 10px;
    left: 10px;
    width: 50px !important;
}
.size-change {
    cursor: pointer;
    padding: 5px;
    transition: ease-in-out 0.20s;
    position: relative;
}

.size-change:hover {
    background: #676767;
    color: #fff;
}

.size-change:after {
	content: "";
	background: #afafaf;
	position: absolute;
	right: -2px;width: 1px;
	height: 145%;top: -5px;
}
.size-change:last-child:after{
	content: initial;

}
#controls svg{width:50px;}

#controls circle:hover {
    fill-opacity: 1;
}
.p_detail{     padding: 10px;
    z-index: 200;
    background: #fff;
    display: flex;
    align-items: center;
    justify-content: center;
    width: 350px;
    height: 100vh;
    position: absolute;
    border-left: 1px solid #ccc;
    right: 0px;
    transition: ease-in-out 0.3s;
    -webkit-transition: ease-in-out 0.3s;
    transform: translate(0%, 0px);
}
.p_detail.p-hide {
    transform: translate(100%, 0px);
}
.d-none{
  display: none !important;
}
.table-sm td, .table-sm th {
    padding: 0.3rem;
    font-size: 14px;
}
.tp{
      display: none;
    min-width: 120px;
    background-color: black;
    color: #fff;
    text-align: center;
    border-radius: 6px;
    padding: 5px 10px;
    position: absolute;
    z-index: 1;
    font-size:12px;
}

.close-detail{
   position: absolute;
    top: 10px;
    left: 10px;
    cursor: pointer;
}
.highlight{
 
    animation-duration: 1.7s;
    animation-name: blink;
    animation-iteration-count: infinite;
    -webkit-animation-duration: 1.7s;
    -webkit-animation-name: blink;
    -webkit-animation-iteration-count: infinite;
}

.greyBackground {
        background: #fbfbfb;
      }

      .legend-heading {
        background: #828282;
        padding: 0px 10px;
        font-size: 20px;
        display: inline-block;
        width: auto;
      }
      .form-text span {
        color: #000;
        display: inline-block;
      }

      .contact-2 {
        /* padding-top: 10rem; */
        /* padding-bottom: 7rem; */
      }

      .main-title {
        margin-bottom: 60px;
      }

      .main-title h1 {
        font-size: 34px;
        font-weight: 600;
        margin: 0 0 15px;
      }

      .legend-heading {
        background: #828282;
        padding: 0px 10px;
        font-size: 20px;
        display: inline-block;
        width: auto;
        color: white;
      }

      fieldset {
        border: 1px solid #c0c0c0;
        margin: 0 2px;
        padding: 0.35em 0.625em 0.75em;
      }

      .form-check {
        position: relative;
        display: block;
        padding-left: 1.25rem;
      }

      .form-text {
        display: block;
        margin-top: 0.25rem;
      }

      .form-text span {
        color: #000;
        display: inline-block;
      }

      .form-check p,
      .form-check ul {
        display: inline-block;
        padding-left: 10px;
        vertical-align: top;
        margin: 0;
      }

      ul {
        margin: 0;
        padding: 0;
        list-style: none;
        color: #535353;
      }

      p {
        font-size: 16px;
        line-height: 25px;
        color: #535353;
        font-weight: 400;
        font-family: "Montserrat", sans-serif;
        margin-top: 0;
        margin-bottom: 1rem;
      }
      .contact-2 .form-control {
        padding: 10px 17px;
        color: #495057 !important;
        width: 100%;
        min-height: 50px;
        font-size: 15px;
        font-weight: 500;
        border-radius: 3px;
        background: #ffffff;
        border: 1px solid #dbdbdb;
        box-shadow: 0 1px 3px 0 rgb(0 0 0 / 6%);
      }

      .form-control {
        display: block;
        line-height: 1.5;
        transition: border-color 0.15s ease-in-out, box-shadow 0.15s ease-in-out;
      }

		.crossIcon {
		top: 10px;
		right: 0px;
		font-size: 22px;
		position: absolute;
		cursor: pointer;
		}

	.booking-form{
		width: 100%;
		position: absolute;
		left: 0;
		top: 0;
		transition:ease-in-out 0.44s;
		-webkit-transition:ease-in-out 0.44s;
		-moz-transition:ease-in-out 0.44s;
		transform: translateX(-100%);
		z-index: 9999;
	}
	  
	.form-display{
		transform:translateX(0%);
	}

   @keyframes blink {
      0% {
     
      fill:#cecece;
    }
    50%{
      
      fill:#ffffff;

    }
    100% {
     
       fill:#cecece;
    }
}
@-webkit-keyframes blink {
     0% {
     
      fill:#cecece;
    }
    50%{
      
      fill:#ffffff;

    }
    100% {
 
       fill:#cecece;
    }
}



    </style>


